In the second stage the \ensuremath{\D^0}\xspace and \ensuremath{\Dbar^0}\xspace lifetimes are fitted simultaneously using a binned maximum likelihood fit. The bins are chosen to maximize the sensitivity to $A_{\Gamma}${} while maintaining good statistical precision. The fit uses the \ensuremath{\D^0}\xspace mass and $\Delta m$  as input variables and includes a constraint on the difference in lifetimes.

The measured lifetimes are then used to calculate the effective lifetimes for the \ensuremath{\D^0}\xspace and \ensuremath{\Dbar^0}\xspace decays to the same final state.

