\section{Preliminaries}

\subsection{Abstract Tropical Curves}

An abstract tropical curve is a metric graph $G$ with an assignment of a direction vector to each edge $e \in E(G)$. The direction vector of an edge $e$ is denoted by $\vec{e}$. The direction vector of a vertex $v$ is the sum of the direction vectors of the edges incident to $v$. We require that the direction vectors at each vertex be in the interior of the unit simplex $\Delta^{|E(G)|-1}$.

Two abstract tropical curves are equivalent if there exists a homeomorphism between their underlying graphs that preserves the direction vectors of the edges. This equivalence relation defines the moduli space $\mathcal{M}_{=1,n}(d)$ of genus $1$ abstract tropical curves with $n$ marked unbounded edges.

